import React from "react";
import { NavLink } from "react-router-dom";
const Navbar = () => {
  return (
    <>
      <div className="container-fluid nav-bg">
        <nav className="navbar navbar-expand-sm navbar-light ">
          <div className="container-fluid">
           
          </div>
        </nav>
      </div>
    </>
  );
};

export default Navbar;
